import BarChart from "../components/Charts/BarChart";
import PieChart from "../components/Charts/PieChart";
import Grid from "@mui/material/Grid";
import Paper from "@mui/material/Paper";
import { Translate } from "../utils/utils";
const DashboardPage = () => {
	return (
		<Grid container spacing={3}>
			{/* Chart */}
			<Grid item xs={12} md={8} lg={9}>
				<Paper
					sx={{
						p: 2,
						display: "flex",
						flexDirection: "column",
						height: 240,
					}}
				>
					<BarChart
						text={Translate("bar.title")}
						subtitle={`${Translate(
							"bar.source"
						)} <a href="https://worldpopulationreview.com/world-cities" target="_blank">${Translate(
							"bar.worldLargestPopulation"
						)}</a>`}
						yAxisTitle={Translate("bar.PopulationMillion")}
						tooltip={`${Translate(
							"bar.Population2021"
						)}<b>{point.y:.1f} ${Translate("millions")}</b>`}
						DataName={Translate("Population")}
					></BarChart>
				</Paper>
			</Grid>

			<Grid item xs={12} md={4} lg={3}>
				<Paper
					sx={{
						p: 2,
						display: "flex",
						flexDirection: "column",
						height: 240,
					}}
				>
					<PieChart></PieChart>
				</Paper>
			</Grid>
			{/* Recent Orders */}
			<Grid item xs={12}>
				<Paper sx={{ p: 2, display: "flex", flexDirection: "column" }}>
					<Orders />
				</Paper>
			</Grid>
		</Grid>
		// <Grid container spacing={2} sx={{ mt: 2 }}>
		// 	<Grid item xs={12} sm={8} md={6} lg={6} elevation={6}>

		// 	</Grid>
		// 	<Grid item xs={12} sm={8} md={6} lg={6} elevation={6}>

		// 	</Grid>
		// </Grid>
	);
};

export default DashboardPage;
